-- ----------------------------
-- Table structure for `ubicacion`
-- ----------------------------
DROP TABLE IF EXISTS `ubicacion`;
CREATE TABLE `ubicacion` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_departamento` int(11) NOT NULL,
  `departamento` varchar(150) NOT NULL,
  `id_provincia` int(11) NOT NULL,
  `provincia` varchar(150) NOT NULL,
  `id_seccion` int(11) NOT NULL,
  `seccion` varchar(150) NOT NULL,
  `id_canton` int(11) NOT NULL,
  `canton` varchar(150) NOT NULL,
  `id_localidad` int(11) NOT NULL,
  `localidad` varchar(150) NOT NULL,
  `id_distrito` int(11) NOT NULL,
  `distrito` varchar(150) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
-- ----------------------------
-- Records of ubicacion
-- ----------------------------

-- Create tables section -------------------------------------------------
-- Table departamento
DROP TABLE IF EXISTS `departamento`;
CREATE TABLE departamento
(
  id_departamento Int NOT NULL AUTO_INCREMENT,
  id_minedu Int NOT NULL,
  departamento Varchar(150) NOT NULL,
 PRIMARY KEY (id_departamento)
);
-- Table provincia
DROP TABLE IF EXISTS `provincia`;
CREATE TABLE provincia
(
  id_provincia Int NOT NULL AUTO_INCREMENT,
  id_departamento Int NOT NULL,
  id_minedu Int NOT NULL,
  id_minedu_departamento Int NOT NULL,
  provincia Varchar(150) NOT NULL,
 PRIMARY KEY (id_provincia,id_departamento)
);
-- Table seccion
DROP TABLE IF EXISTS `seccion`;
CREATE TABLE seccion
(
  id_seccion Int NOT NULL AUTO_INCREMENT,
  id_departamento Int NOT NULL,
  id_provincia Int NOT NULL,
  id_minedu Int NOT NULL,
  id_minedu_departamento Int NOT NULL,
  id_minedu_provincia Int NOT NULL,
  seccion Varchar(150) NOT NULL,
 PRIMARY KEY (id_seccion,id_provincia,id_departamento)
);
-- Table canton
DROP TABLE IF EXISTS `canton`;
CREATE TABLE canton
(
  id_canton Int NOT NULL AUTO_INCREMENT,
  id_departamento Int NOT NULL,
  id_provincia Int NOT NULL,
  id_seccion Int NOT NULL,
  id_minedu Int NOT NULL,
  id_minedu_departamento Int NOT NULL,
  id_minedu_provincia Int NOT NULL,
  id_minedu_seccion Int NOT NULL,
  canton Varchar(150) NOT NULL,
 PRIMARY KEY (id_canton,id_seccion,id_provincia,id_departamento)
);
-- Table localidad
DROP TABLE IF EXISTS `localidad`;
CREATE TABLE localidad
(
  id_localidad Int NOT NULL AUTO_INCREMENT,
  id_departamento Int NOT NULL,
  id_provincia Int NOT NULL,
  id_seccion Int NOT NULL,
  id_canton Int NOT NULL,
  id_minedu Int NOT NULL,
  id_minedu_departamento Int NOT NULL,
  id_minedu_provincia Int NOT NULL,
  id_minedu_seccion Int NOT NULL,
  id_minedu_canton Int NOT NULL,
  localidad Varchar(150) NOT NULL,
 PRIMARY KEY (id_localidad,id_canton,id_seccion,id_provincia,id_departamento)
);
-- Table distrito
DROP TABLE IF EXISTS `distrito`;
CREATE TABLE distrito
(
  id_distrito Int NOT NULL AUTO_INCREMENT,
  id_departamento Int NOT NULL,
  id_provincia Int NOT NULL,
  id_seccion Int NOT NULL,
  id_canton Int NOT NULL,
  id_localidad Int NOT NULL,
  id_minedu Int NOT NULL,
  id_minedu_departamento Int NOT NULL,
  id_minedu_provincia Int NOT NULL,
  id_minedu_seccion Int NOT NULL,
  id_minedu_canton Int NOT NULL,
  distrito Varchar(150) NOT NULL,
 PRIMARY KEY (id_distrito,id_localidad,id_canton,id_seccion,id_provincia,id_departamento)
);

