-- INSERT INTO seccion      (id_minedu, id_departamento, id_provincia, seccion, id_minedu_departamento, id_minedu_provincia) (SELECT A.id_seccion, B.id_departamento, B.id_provincia, A.seccion, A.id_departamento, A.id_provincia FROM ubicacion A, provincia B WHERE A.id_provincia = B.id_minedu AND A.id_departamento = B.id_minedu_departamento GROUP BY A.id_departamento, A.id_provincia, A.id_seccion);
-- INSERT INTO canton       (id_minedu, id_departamento, id_provincia, id_seccion, canton, id_minedu_departamento, id_minedu_provincia, id_minedu_seccion) (SELECT A.id_canton, B.id_departamento, B.id_provincia, B.id_seccion, A.canton, A.id_departamento, A.id_provincia, A.id_seccion FROM ubicacion A, seccion B WHERE A.id_seccion = B.id_minedu AND A.id_departamento = B.id_minedu_departamento AND A.id_provincia = B.id_minedu_provincia GROUP BY A.id_departamento, A.id_provincia, A.id_seccion, A.id_canton);
-- INSERT INTO localidad    (id_minedu, id_departamento, id_provincia, id_seccion, id_canton, localidad, id_minedu_departamento, id_minedu_provincia, id_minedu_seccion, id_minedu_canton) (SELECT A.id_localidad, B.id_departamento, B.id_provincia, B.id_seccion, B.id_canton, A.localidad, A.id_departamento, A.id_provincia, A.id_seccion, A.id_canton FROM ubicacion A, canton B WHERE A.id_canton = B.id_minedu AND A.id_departamento = B.id_minedu_departamento AND A.id_provincia = B.id_minedu_provincia AND A.id_seccion = B.id_minedu_seccion GROUP BY A.id_departamento, A.id_provincia, A.id_seccion, A.id_canton, A.id_localidad);
-- INSERT INTO distrito     (id_minedu, id_departamento, id_provincia, id_seccion, id_canton, id_localidad, distrito, id_minedu_departamento, id_minedu_provincia, id_minedu_seccion, id_minedu_canton, id_minedu_localidad) (SELECT A.id_distrito, B.id_departamento, B.id_provincia, B.id_seccion, B.id_canton, B.id_localidad, A.distrito, A.id_departamento, A.id_provincia, A.id_seccion, A.id_canton, A.id_localidad FROM ubicacion A, localidad B WHERE A.id_localidad = B.id_minedu AND A.id_departamento = B.id_minedu_departamento AND A.id_provincia = B.id_minedu_provincia AND A.id_seccion = B.id_minedu_seccion AND A.id_canton = B.id_minedu_canton GROUP BY A.id_departamento, A.id_provincia, A.id_seccion, A.id_canton, A.id_localidad, A.id_distrito);